import React from "react";
import { IUser, UserComponentType } from "../AppTypes";

class User extends React.Component<UserComponentType, {}> {
    constructor(props: UserComponentType) {
        super(props);
    }

    render() {
        console.log(this.props.userId);
        return <span>User Name: {this.props.userId}</span>;
    }
}

const mapStateToProps = (state: { postsReducer: PostState }) => {
    return state;
};

export default connect(mapStateToProps, { fetchPosts })(User);
